/*Table structure for table `category` */

DROP TABLE IF EXISTS `category`;

CREATE TABLE `category` (
  `category_id` int(11) NOT NULL AUTO_INCREMENT,
  `category_name` varchar(500) CHARACTER SET latin1 NOT NULL,
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COLLATE=utf8_turkish_ci;

/*Data for the table `category` */

insert  into `category`(`category_id`,`category_name`) values (1,'Football'),(2,'Social'),(3,'Sports'),(4,'Politics'),(5,'TV & Entertainment'),(6,'Celebrities'),(7,'Business & Finance');

/*Table structure for table `category_friend` */

DROP TABLE IF EXISTS `category_friend`;

CREATE TABLE `category_friend` (
  `user_id` int(11) DEFAULT NULL,
  `photo` varchar(500) CHARACTER SET latin1 DEFAULT NULL,
  `display_name` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `coins` bigint(20) DEFAULT NULL,
  `exp` int(11) DEFAULT NULL,
  `catg_frndID` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`catg_frndID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_turkish_ci;

/*Data for the table `category_friend` */

/*Table structure for table `comments` */

DROP TABLE IF EXISTS `comments`;

CREATE TABLE `comments` (
  `comment_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `bet_id` int(11) DEFAULT NULL,
  `comment` longtext COLLATE utf8_turkish_ci,
  `comment_time` datetime DEFAULT NULL,
  PRIMARY KEY (`comment_id`),
  KEY `user_id` (`user_id`),
  KEY `bet_id` (`bet_id`),
  CONSTRAINT `comments_bet_id` FOREIGN KEY (`bet_id`) REFERENCES `bets` (`bet_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `comments_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=298 DEFAULT CHARSET=utf8 COLLATE=utf8_turkish_ci;

