/*Table structure for table `user_settings` */

DROP TABLE IF EXISTS `user_settings`;

CREATE TABLE `user_settings` (
  `user_id` int(11) NOT NULL,
  `notify_results` tinyint(1) NOT NULL DEFAULT '1',
  `notify_fb_friend_joining` tinyint(1) NOT NULL DEFAULT '1',
  `notify_achievements` tinyint(1) NOT NULL DEFAULT '1',
  `private` tinyint(1) NOT NULL DEFAULT '0',
  `notify_win_loss` tinyint(1) NOT NULL DEFAULT '1',
  `notify_friend_follows` tinyint(1) NOT NULL DEFAULT '1',
  `notify_comments` tinyint(1) NOT NULL DEFAULT '1',
  `notify_friend_bet_post` tinyint(1) NOT NULL DEFAULT '1',
  `odds_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 - decimal\n, 2 - fraction\n, 3 - american',
  `share_win_loss` tinyint(1) NOT NULL DEFAULT '1',
  `share_my_bets` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`user_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `user_settings_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_turkish_ci;

